(79, 'AGENT DE MAINTENANCE EN HOTELLERIE H/F TAF 2022', 'CDD', '2022-03-02 00:00:00', '2022-12-31 00:00:00', 35, 1250, NULL, 1, 32, 'MONTPELLIER', 'Cet établissement hôtelier 5 * recherche son agent de maintenance polyvalent sous la responsabilité du Responsable de maintenance et de la Directrice d\'Hébergement . Une bonne présentation est requise car le poste peut etre en contact avec la clientèle.'),
(80, 'Employé polyvalent d\'hotellerie (H/F)', 'CDI', '2022-03-10 00:00:00', NULL, 22, 990, NULL, 0, 32, 'Nice', 'les Terrasses d\'EZE seront présentes le 10/03/2022 de 09h30 à 13h30 au Palais de la Mediterrannée de Nice afin de recruter son personnel saisonnier.\r\nDe nombreux postes à pourvoir dans le secteur de l\'hôtellerie: réception, entretien, réservation...'),
(81, 'Agent polyvalent de nettoyage en hôtellerie (H/F)', 'CDI', '2022-03-02 00:00:00', NULL, 39, 1540, NULL, 0, 32, '68 - SOULTZMATT', 'Nous recherchons dès à présent une personne pour embauche à compter d\'aujourd\'hui et pour une période indéterminé.\r\nVous prenez part au nettoyage des chambres et plus globalement au maintien de la propreté de l\'hôtel : l\'escalier, les communs, les toilettes. Vous assurez également la plonge du petit déjeuner et aidez au rangement du linge.'),
(82, 'langue', 'CDI', '2022-03-01 23:00:00', '2022-03-01 23:00:00', 22, 222, NULL, 0, 32, 'dsds', 'dsdsds'),
(83, 'nouvelle date', 'CDI', '2022-03-01 23:00:00', '2022-03-01 23:00:00', 2, 211, NULL, 0, 32, 'dsdsds', 'dsdsdsdsdsd'),
(84, 'Serveur / Serveuse de restaurant (H/F)', 'CDI', '2022-03-02 23:00:00', NULL, 35, 1250, 1, 1, 34, 'Bordeaux', 'Restaurant Gastronomique recherche Serveur H/F afin de compléter son équipe .\r\nUne expérience dans un restaurant gastronomique serait souhaitée.\r\nVous êtes motivé/e pour vous investir dans notre entreprise à taille humaine , ponctuel/le et aimez travailler en équipe .'),
(85, 'Cuisinier / Cuisinière', 'CDD', '2022-03-02 23:00:00', '2022-07-07 22:00:00', 22, 1100, NULL, 0, 34, 'Bordeaux', 'Dans un restaurant traditionnel, vous serez chargé(e) de :\r\n- préparer les entrées, les plats et desserts;\r\n- dresser les assiettes et les envoyer;\r\n- entretenir votre plan de travail.\r\nVous connaissez les normes d\'hygiène et de sécurité.');

